import React from 'react';

const CurrentUsage = ({ lastUpdate }) => {
  return(
    <div style={{display: "inline-block"}}>
      <h1>{lastUpdate.y}</h1>
      <p>Total</p>
      <h1>{lastUpdate.y}</h1>
      <p>Usadas</p>
      <h1>{lastUpdate.free_bikes}</h1>
      <p>Libres</p>
    </div>
  );
};

export default CurrentUsage;
